import { AlipayCircleOutlined, TaobaoCircleOutlined, WeiboCircleOutlined } from '@ant-design/icons';
import React, {Component, Fragment} from "react"
import {  Form, Input, Icon,  Button, Checkbox, Select }  from'antd'

import {withRouter} from "react-router-dom" 

const {Item} = Form


class Login extends Component{
    constructor(props){
        super(props);
    }
    render(){
        const layout = {
            labelCol: {
              xs: { span: 24, offset: 12},
              sm: { span: 24, offset: 12},
            },
            wrapperCol: {
              xs: { span: 6, offset: 6 },
              sm: { span: 6, offset: 6 },
            },
          };
          const tailLayout = {
            wrapperCol: {
              offset: 8,
              span: 16,
            },
          };
        const { getFieldDecorator } = this.props.form;
        return (
            <Form
            {...layout}
            name="basic"
            style= {{marginTop: 25 }}

          >
           <Form.Item>
          {getFieldDecorator('username', {
            rules: [{ required: true, message: 'Please input your username!' }],
          })(
            <Input
              prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />}
              placeholder="Username"
            />,
          )}
        </Form.Item>


              <Form.Item>
          {getFieldDecorator('password', {
            rules: [{ required: true, message: 'Please input your Password!' }],
          })(
            <Input
              prefix={<Icon type="lock" style={{ color: 'rgba(0,0,0,.25)' }} />}
              type="password"
              placeholder="Password"
            />,
          )}
        </Form.Item>


            <Item {...tailLayout}>
              <Button type="primary" htmlType="submit" onClick = {this.onClick}>
                Submit
              </Button>
            </Item>
          </Form>
        )
    }
}
export default Form.create({ name: 'normal_login' }) (withRouter(Login));
